  04> WILLIAMS, Russell Philip Seton
  b 28.03.1935
  Russell b. at Wellington. Address: 113 Selwyn Avenue, Mission Bay, Auckland.
  Russell moved to Auckland with the family in 1944. He was educated at Kings School and
  Kings College and chose a career as a Chartered Accountant, working with Coopers &
  Lybrand for eight years and with Winstone Ltd for 26 years. Involvement in management
  and marketing led to a life-long interest in property. He retired when Fletcher
  Challenge purchased Winstone in 1988 then acted as Project Manager for the Auckland
  Marine Rescue Centre built at Mechanics Bay until 1991.
  Russell has given strong community service with the Auckland Regiment (Captain, 14 years), surf life
  saving (21 years) and triathlons (9 years). He has acted as treasurer and as sports commentator. He
  holds service awards from both organisations and was NZ's first helicopter lifeguard.
